import React from "react";

const movies = [
  {
    id: 1,
    name: "Shawshank Redemption",
    priority: true,
  },
  {
    id: 2,
    name: "The Dark Knight",
    priority: true,
  },
  {
    id: 3,
    name: "Fight Club",
    priority: false,
  },
];

const List = () => {
  return (
    <div className="bg-light m-2 rounded p-5">
      {movies.map(movie => (
        <div className="bg-warning rounded m-2">
          <p className="p-3">
            {movie.name}
            {movie.priority == true && <span className="text-danger"> **</span>}
          </p>
        </div>
      ))}
    </div>
  );
};

export default List;
